import React from 'react';
import styled from 'styled-components';
import { colors } from '../../styles';

const Box = styled.div`
  min-height: 300px;
  padding: 50px 0;
  background-color: ${colors().grey};
`;

function Success() {
  return <Box>Success!</Box>;
}

export default Success;
